import React, { useState } from 'react';

const Exe1 = () => {
  const [increase, setIncrease] = useState(0);

  const handleClick = () => {
    setIncrease((count) => count + 1);
  };
  return (
    <div>
      <h2>Counter</h2>
      <p>{increase}</p>
      <button onClick={handleClick}>Increase</button>
    </div>
  );
};

export default Exe1;
